(276, 'Some cells require that you use valid codes from the Browse Tree Guide (BTG). The BTG is a separate Excel file that can be downloaded from seller Help. BTGs are category-specific and contain the rules that Amazon uses to assign products to categories on our site. In it you will find mappings between browse nodes and Amazon\'s controlled terms which allow products to surface in those categories. In the BTG for your category, find the category most appropriate for your product, then use the corresponding query to determine what field and value you need to put in your template to place your product in that category.', 'Some cells require that you use valid codes from the Browse Tree Guide (BTG). The BTG is a separate Excel file that can be downloaded from seller Help. BTGs are category-specific and contain the rules that Amazon uses to assign products to categories on our site. In it you will find mappings between browse nodes and Amazon\'s controlled terms which allow products to surface in those categories. In the BTG for your category, find the category most appropriate for your product, then use the corresponding query to determine what field and value you need to put in your template to place your product in that category.', 'Some cells require that you use valid codes from the Browse Tree Guide (BTG). The BTG is a separate Excel file that can be downloaded from seller Help. BTGs are category-specific and contain the rules that Amazon uses to assign products to categories on our site. In it you will find mappings between browse nodes and Amazon\'s controlled terms which allow products to surface in those categories. In the BTG for your category, find the category most appropriate for your product, then use the corresponding query to determine what field and value you need to put in your template to place your product in that category.', 'Some cells require that you use valid codes from the Browse Tree Guide (BTG). The BTG is a separate Excel file that can b